import React, { useState } from 'react';
import {
  View,
  Text,
  ScrollView,
  TouchableOpacity,
  StyleSheet,
  SafeAreaView,
  Linking,
} from 'react-native';
import { LinearGradient } from 'expo-linear-gradient';
import { useTheme } from '../context/ThemeContext';

const SupportScreen = ({ navigation }) => {
  const theme = useTheme();
  const [expandedFaq, setExpandedFaq] = useState(null);

  const contactMethods = [
    {
      icon: 'üìû',
      title: 'Call Us',
      subtitle: '+91 79 1234 5678',
      action: () => Linking.openURL('tel:+917912345678'),
      gradient: ['#10B981', '#059669'],
    },
    {
      icon: 'üìß',
      title: 'Email Us',
      subtitle: 'support@gujaratportal.gov.in',
      action: () => Linking.openURL('mailto:support@gujaratportal.gov.in'),
      gradient: ['#3B82F6', '#2563EB'],
    },
    {
      icon: 'üí¨',
      title: 'Live Chat',
      subtitle: 'Chat with our team',
      action: () => {},
      gradient: ['#8B5CF6', '#7C3AED'],
    },
  ];

  const faqs = [
    {
      question: 'How do I apply for a new electricity connection?',
      answer: 'Go to Utility Services ‚Üí Select Electricity ‚Üí Choose your provider ‚Üí Upload required documents ‚Üí Fill the form ‚Üí Submit application.',
    },
    {
      question: 'What documents are required for name change?',
      answer: 'You need: 1) Identity Proof (Aadhaar/PAN), 2) Address Proof (Utility Bill/Ration Card), 3) Name Change Proof (Marriage Certificate/Gazette/Affidavit).',
    },
    {
      question: 'How long does application processing take?',
      answer: 'Processing time varies by service: Utility services: 7-15 days, Company formation: 15-30 days, Government grants: 30-60 days.',
    },
    {
      question: 'Can I track my application status?',
      answer: 'Yes! Go to Dashboard ‚Üí My Applications to view all your applications and their current status.',
    },
    {
      question: 'How do I upload documents?',
      answer: 'During application, you can upload documents by taking a photo or selecting from gallery. Our AI will automatically extract information.',
    },
    {
      question: 'Is my data secure?',
      answer: 'Yes, all your data is encrypted and stored securely. We follow government security standards and never share your information.',
    },
  ];

  const helpTopics = [
    { icon: 'üìÑ', title: 'Getting Started', desc: 'Learn the basics' },
    { icon: 'üé•', title: 'Video Tutorials', desc: 'Watch how-to videos' },
    { icon: 'üìö', title: 'User Guide', desc: 'Complete documentation' },
    { icon: 'üí°', title: 'Tips & Tricks', desc: 'Pro tips for faster processing' },
  ];

  return (
    <SafeAreaView style={styles.container}>
      {/* Header */}
      <View style={styles.header}>
        <TouchableOpacity
          onPress={() => navigation.goBack()}
          style={styles.backButton}
        >
          <Text style={styles.backIcon}>‚Üê</Text>
        </TouchableOpacity>
        <View style={styles.headerContent}>
          <Text style={styles.headerTitle}>Support & Help</Text>
          <Text style={styles.headerSubtitle}>We're here to help you</Text>
        </View>
      </View>

      <ScrollView showsVerticalScrollIndicator={false}>
        {/* Contact Methods */}
        <View style={styles.section}>
          <Text style={styles.sectionTitle}>Contact Us</Text>
          {contactMethods.map((method, index) => (
            <TouchableOpacity
              key={index}
              onPress={method.action}
              activeOpacity={0.8}
            >
              <LinearGradient
                colors={method.gradient}
                start={{ x: 0, y: 0 }}
                end={{ x: 1, y: 1 }}
                style={styles.contactCard}
              >
                <View style={styles.contactIconContainer}>
                  <Text style={styles.contactIcon}>{method.icon}</Text>
                </View>
                <View style={styles.contactContent}>
                  <Text style={styles.contactTitle}>{method.title}</Text>
                  <Text style={styles.contactSubtitle}>{method.subtitle}</Text>
                </View>
                <View style={styles.contactArrow}>
                  <Text style={styles.arrowIcon}>‚Üí</Text>
                </View>
              </LinearGradient>
            </TouchableOpacity>
          ))}
        </View>

        {/* FAQs */}
        <View style={styles.section}>
          <Text style={styles.sectionTitle}>Frequently Asked Questions</Text>
          {faqs.map((faq, index) => (
            <TouchableOpacity
              key={index}
              onPress={() => setExpandedFaq(expandedFaq === index ? null : index)}
              style={styles.faqCard}
              activeOpacity={0.7}
            >
              <View style={styles.faqHeader}>
                <Text style={styles.faqIcon}>‚ùì</Text>
                <Text style={styles.faqQuestion}>{faq.question}</Text>
                <Text style={styles.faqToggle}>
                  {expandedFaq === index ? '‚àí' : '+'}
                </Text>
              </View>
              {expandedFaq === index && (
                <View style={styles.faqAnswer}>
                  <Text style={styles.faqAnswerText}>{faq.answer}</Text>
                </View>
              )}
            </TouchableOpacity>
          ))}
        </View>

        {/* Help Topics */}
        <View style={styles.section}>
          <Text style={styles.sectionTitle}>Help Topics</Text>
          <View style={styles.topicsGrid}>
            {helpTopics.map((topic, index) => (
              <TouchableOpacity
                key={index}
                style={styles.topicCard}
                activeOpacity={0.7}
              >
                <Text style={styles.topicIcon}>{topic.icon}</Text>
                <Text style={styles.topicTitle}>{topic.title}</Text>
                <Text style={styles.topicDesc}>{topic.desc}</Text>
              </TouchableOpacity>
            ))}
          </View>
        </View>

        {/* Working Hours */}
        <View style={styles.section}>
          <View style={styles.hoursCard}>
            <Text style={styles.hoursIcon}>üïê</Text>
            <View style={styles.hoursContent}>
              <Text style={styles.hoursTitle}>Support Hours</Text>
              <Text style={styles.hoursText}>Monday - Friday: 9:00 AM - 6:00 PM</Text>
              <Text style={styles.hoursText}>Saturday: 9:00 AM - 1:00 PM</Text>
              <Text style={styles.hoursText}>Sunday: Closed</Text>
            </View>
          </View>
        </View>

        <View style={{ height: 40 }} />
      </ScrollView>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#F8FAFC',
  },
  header: {
    flexDirection: 'row',
    alignItems: 'center',
    paddingHorizontal: 20,
    paddingVertical: 16,
    backgroundColor: '#FFFFFF',
    borderBottomWidth: 1,
    borderBottomColor: '#E2E8F0',
  },
  backButton: {
    marginRight: 12,
  },
  backIcon: {
    fontSize: 24,
